function Cart({path, name, description}) {
   
    return (
        <div style={{backgroundColor:'white', boxShadow:'0px 4px 8px rgba(0,0,0,0.9)', margin:10, borderRadius:"10", padding:20}}>
            <center>
            <img src={path} alt="flower" width={90} height={90} style={{border:"2px solid black", borderRadius:"50%"}} />
            <h2>{name}<span style={{fontWeight:20, font}}> .2nd</span></h2>
            <p>{description}</p>
            </center>
        </div>
    )
}
export default Cart;
